class Footer extends React.Component {
    render() {
        return (


            <div className="jumbotron jumbotron-fluid">
                <div className="container">


                    <div classNameName="row">

                        <div classNameName="col-md-12">
                            <div className="col-md-2">
                                <h1>What's new</h1>
                            </div>
                        </div>
                    </div>


                </div>


            </div>




        );
    }
}

export default Footer;
